var self=this;$(document).ready(function(){$("#connectBtn").click(function(n){n.preventDefault();var t=$("#hostname").val(),e=$("#port").val();ConnectionManager(t,e).testConnection(function(n){if(1==n.success){var i=require("path").join(__dirname,"files.html"),o={host:t,port:e};window.name=JSON.stringify(o),window.location.assign(i)}})})});